import { View, Text } from "react-native";
import {styles} from './ClientesCases'
import { Image } from "react-native-elements";

export default function ClientesCases() {
    const empresasFicticias = [
        "TechVision Solutions",
        "InovaCorp Services",
        "EcoFutura Innovations",
        "DigitalPulse Technologies",
        "FutureSync Solutions"
    ];
    return (
        <View style={styles.container}>
                <Image source={require('../../assets/images/easyCompras.png')} style={styles.imagemEmpresa} />
            <View style={styles.containerLogo}>
                <Text style={styles.titulo1}>EASY</Text>
                <Text style={styles.titulo2}>COMPRAS</Text>
            </View>

            <View>
                <Image source={require('../../assets/images/emp1.png')} style={styles.imagemEmpresa} />
            </View>
        </View>
    )
}
